class User:
    def __init__(self, user_type):
        self.user_type = user_type

    def can_upload(self):
        return self.user_type in ['admin', 'editor']


class FileUploader:
    def __init__(self, user):
        self.user = user
        self.submissions = []
        self.action_types = ['Create', 'Update', 'Delete']

    def upload_file(self, file_path):
        if not self.user.can_upload():
            return "Error: User does not have permission to upload files."

        if not file_path.endswith('.csv'):
            return "Error: File format must be CSV."

        data = self.read_csv(file_path)
        if not self.validate_submission(data):
            return "Error: Submission is invalid."

        if self.is_duplicate_submission(data):
            return "Error: Duplicate submission detected."

        self.submissions.append(data)
        return "File uploaded successfully."

    def read_csv(self, file_path):
        # Simulate reading a CSV file and returning data
        # In a real implementation, this would read the file contents
        return [{'DUNS': '123456789', 'ActionType': 'Create'}]

    def validate_submission(self, data):
        for entry in data:
            if 'DUNS' not in entry or not entry['DUNS']:
                return False
            if 'ActionType' not in entry or entry['ActionType'] not in self.action_types:
                return False
        return True

    def is_duplicate_submission(self, data):
        # Simulate checking for duplicates
        for entry in data:
            if entry in self.submissions:
                return True
        return False

    def get_submission_status(self):
        return self.submissions


